window.bookSummaryJSON = "<p>A full-cast audiobook of a new stand-alone romance from number-one <i>New York Times</i> best-selling author Lauren Blakely, performed by Andi Arndt, Dan Bittner, Jason Clarke, and Emma Wilder!</p> <p>All I want for the holidays is the willpower to resist my brother’s sexy, charming, easy-on-the-eyes new business partner.</p> <p>Instead, I'm stuck planning all the holiday parties with the one guy who makes me want to break my dating diet.</p> <p>Who thought that was a good idea?</p> <p>Oh, me. Yep, brilliant, strategic me who raised her hand and said yes I’d love to hang mistletoe with that hot former sports star. (Note to self: Mistletoe leads to toe-curling, knee-weakening kisses.)</p> <p>And I’d love to get snowed in with the one guy I shouldn’t fall for. (Addendum to the note to self: You know exactly where eight inches of snow leads to. Ahem, eight inches.)</p> <p>As long as I can make it through the holidays, I’ll be on my merry way, fa la la la la. But the holidays have a surprise for me.</p> <p>This special production also includes a behind-the-scenes conversation with Andi Arndt and Dan Bittner, a blooper reel, and an exclusive sneak preview of <i>Asking for a Friend</i>, starring Andi Arndt, Jason Clarke, Zachary Webber, and Erin Mallon!</p>"; 
